import * as S from './ExpenseItem.style';

function ExpenseItem() {
    return (
        <S.ExpenseItem>
            <S.Date>14 Nov 2021</S.Date>
            <S.Description>iPhone</S.Description>
            <S.Amount>73000</S.Amount>
        </S.ExpenseItem>
    );
}

export default ExpenseItem;
